  return (
    <div className='container '>
      <div className='navbar navbar__section '>
        <div><h3><Link to="/"><i class="fa-solid fa-house-chimney me-2"></i>MAHSULOTLAR</Link></h3></div>
        <div><h3><Link c to="/korzinka"><i class="fa-solid fa-cart-shopping me-2"><sup>{navCount}</sup></i>SAVATCHA</Link></h3></div>
      </div>
    </div>
  )
}
